(29, 'Utusan Kemenpora Menghadiri Upacara Wiasuda ke-140 Unsri Sesi Kedua', '<h2><img width=\"585px\" src=\"http://www.unsri.ac.id/upload/images/IMG_155422022019_2305.JPG\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"></span><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Pada sesi ini Rektor Universitas Sriwijaya, Prof. Dr. Anis Saggaf, MSCE melantik 715 orang sarjana dari tiga fakultas, yaitu Fakultas Ekonomi, Fakultas Hukum, dan Fakultas Teknik. Acara digelar di tempat yang sama dengan sesi satu pada hari sebelumnya, yaitu di Gedung Auditorium kampus Unsri Indralaya, 20 Februari 2019.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_1532%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Pada sesi kedua 21 Februari dihadiri Deputi I Bidang Pemberdayaan Pemuda Kementerian Pemuda dan Olah Raga, Prof. Dr. Faisal Abdullah, S.H., M. Si.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_1567%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Di hadapan para wisudawan-wisudawati, Anggota Senat Unsri, para Guru Besar, para orang tua wali mahasiswa, dan undangan lainnya, Prof. Dr. Faisal Abdullah menyampaikan ucapan selamat kepada para wisudawan-wisudawati untuk menikmati kebebasannya. Ia juga mengingatkan bahwasannya dengan diwisudanya sebagai sarjana para wisudawan akan memasuki dunia nyata yang merupakan pendidikan yang sesungguhnya dan tidak lagi mendapatkan pendidikan dan bimbingan dari dosen.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_1562%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">“Bertebaranlah engkau diseluruh penjuru, bukan hanya tanah air, tetapi jagat raya ini. Anda jangan bercerai berai Anda memiliki korp induk almamater, yaitu Universitas Sriwijaya yang menjadikan Anda semua menjadi tumpuan harapan sebagaimana Universitas Sriwijaya menjalankan fungsinya di dalam masyarakat sangat bergantung kepada kemampuan dan dedikasi Anda di dalam masyarakat,” kata Prof. Dr. Faisal Abdullah.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_1542%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Ia juga menyampaikan terima kasih kepada Rektor dan semua jajarannya yang telah bersama-sama dengan Kemenpora menjalankan satu misi yaitu mendidik pemuda-pemuda untuk lebih visioner dan mememiliki suatu kemampuan untuk bekerja. Ia mengharapkan kerjasamanya dapat ditingkatkan lagi dengan Kemenpora membuka S2 Menejemen Iven Olahraga di Universitas Sriwijaya.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_1552%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">“Selain itu ke depan akan kita buka juga dan akan kita titip satu program yang selama ini dijalankan oleh Kemenpora, yaitu Politeknik Olah Raga Indonesia yang ada di Jakabaring yang inshaallah kita ingin titipkan dan mengembangkan di bawah panji Universitas Sriwijaya,” kata Prof. Dr. Faisal Abdullah. (Humas)</p><h2><br></h2><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p></h2>', 'news', 'IMG_155422022019_2305.JPG', '2019-05-31 16:50:01', 76, 'utusan-kemenpora-menghadiri-upacara-wiasuda-ke-140-unsri-sesi-kedua-99'),
(30, 'Upacara Wisuda ke-140 Pertama Kali Penerapan Statuta Baru Unsri', '<p><br></p><p><img width=\"585px\" src=\"http://www.unsri.ac.id/upload/images/IMG_142520022019_1481.JPG\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"></span></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Hal itu disampaikan Rektor Universitas Sriwijaya (Unsri), Prof. Dr. Anis Saggaff, MSCE pada upacara Wisuda ke-140 di Gedung Auditorium kampus Unsri Indralaya, 20 Februari 2019.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">“Wisuda ke-140 kali ini pertamakali Universitas Sriwijaya menerapkan statuta baru dimana tidak lagi rapat senat terbuka, tetapi upacara wisuda,” kata Rektor dihadapan para wisudawan-wisudawati, Anggota Senat, para Guru Besar, dan undangan lainnya.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_1408%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Pada wisuda kali ini juga pertama kali lagu IKA Unsri karangan Ketua IKA Unsri, Dr. Agung Firman Sampurna dilantunkan.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Wisuda ke-140, Unsri melepas 1.693 sarjana baru yang pelaksanaannya dibagi menjadi dua sesi, yaitu tanggal 20 Februari melepas 978 orang alumni dan 21 Februari 715 orang alumni.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_1422%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Sarjana yang dilepas merupakan alumni Fakultas Ekonomi 252 terdiri dari D3 Akuntansi 10 orang, D3 Kesekretariatan 6 orang, S1 Ilmu Manajemen 57 orang, Ilmu Pembangunan 54 orang, Ilmu Akuntansi 90 orang. S2 Ilmu ekonomi 12 orang, Ilmu Manajemen 5 orang, Magister Manajemen 17 orang, S3 Doktor Ilmu Ekonomi 1 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Fakultas Hukum 270 orang terdiri dari S1 Ilmu Hukum 180 orang, S2 Ilmu Hukum 8 orang, S2 Kenotariatan 78 orang. Doktor Ilmu Hukum 4 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_1438%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Fakultas Teknik 193 orang terdiri dari Teknik Sipil 35 orang, Teknik Pertambangan 43 orang, Teknik Kimia 11 orang, Teknik Elektro 9 orang, Teknik Mesin 44 orang, Teknik Arsitektur 18 orang, Teknik Geologi 23 orang. S2 Teknik Kimia 5 orang, Teknik Sipil 0 orang, Teknik Pertambangan 0, Teknik Mesin 5 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Fakultas Kedokteran 202 orang terdiri dari Ilmu Keperawatan 5 orang, Ilmu Pendidikan Dokter 169 orang, Pendidikan Dokter Gigi 4 orang, Psikologi 7 orang; Profesi Keperawatan 2 orang, Dokter Gigi 5 orang, dan Kedokteran 2 orang; PPDS- Sp1 THT-KL 1 orang, Patologi Anatomi 3 orang; PPDS-Sp2 Ilmu Penyakit Dalam 3 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Fakultas Pertanian 153 orang terdiri dari S1 Agribisnis 38 orang, Ilmu Hama dan Penyakit Tumbuhan 4 orang, Teknik Pertanian 20 orang , Teknologi Pertanian 11 orang, Peternakan 14 orang, Budidaya Perairan 5 orang, Teknologi Hasil Perikanan 9 orang, Agroekoteknologi 41 orang S2 Ilmu Tanaman 3 orang dan Agribisnis 8 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">FKIP 262 orang terdiri dari S1 Pendididkan Bahasa Inggris 14 orang, Pendidikan Bahasa Indonesia 13 orang, PPKN 14 orang, Pendidikan Sejarah 26 orang, Pendidikan Ekonomi 11 orang, Bimbingan Konseling 10 orang, Pendidikan Teknik Mesin 22 orang, Pendidikan Matematika 56 orang, Pendidikan Fisika 10 orang, Pendidikan Kimia 2 orang, Pendidikan Biologi 25 orang, PGSD 21 orang, PAUD 4 orang, Penjaskes 11 orang, Pendidikan Luar Sekolah 6 orang. S2 Pendidikan Bahasa 2 orang, Teknologi Pendidikan 9 orang, Pendidikan Olahraga 2 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Fisip 95 orang terdiri dari S1 Ilmu Administrasi Negara 41 orang, Sosiologi 28 orang, Ilmu Komunikasi 17 orang. S2 Magister Administrasi Publik4 orang, Sosiologi 5 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Mipa 81 orang terdiri dari S1 Matematika 24 orang, Fisika 11 orang, Kimia 9 orang, Biologi 4 orang, Farmasi 18 orang, Ilmu Kelautan 11 orang. S2 Fisika 2 Orang, Kimia 3 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Fakultas Ilmu Komputer 116 orang terdiri dari D3 Komputerisasi Akuntansi 8 orang, Manajemen Informatika 4 orang, Teknik Komputer 7 orang. S1 Sistem Komputer 18 orang, Sistem Informasi 33 orang, Teknik Informatika 38 orang. S2 Magister Teknik Informatika 8 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Fakultas Kesehatan Masyarakat melepas 59 orang terdiri dari S1 Kesehatan Masyarakat 51 orang, S2 Ilmu Kesehatan Masyarakat 8 orang.<br>Program Pascasarjana melepas 10 orang terdiri dari S2 Pengelolaan Lingkungan 6 orang dan S3 Ilmu Lingkungan 4 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Alumni berpredikat dengan pujian sebanyak 193 orang. Indek Prestasi Komulatif terbesar 4,0 diperoleh Meihana Program Doktor Ilmu Pertanian dan Muhammad Zahir dari Program Magister Teknik Mesin, terbesar kedua diperoleh Veizzy Utama S1 FKIP Bimbingan dan Konseling dengan IPK (3,93), dan terbesar ketiga diraih Hikmah Zalifah Putri S1 FKIP Program Studi Pendidikan Bahasa Inggris dengan IPK (3,90).&nbsp;<strong>Humas</strong></p>', 'news', 'IMG_1438_-_Copy.JPG', '2019-05-31 16:49:16', 38, 'upacara-wisuda-ke-140-pertama-kali-penerapan-statuta-baru-unsri-64'),
(31, 'DPW I POPMASEPI Gelar Seminar Nasional Di Universitas Sriwijaya', '<p><br></p><p><img width=\"585px\" src=\"http://www.unsri.ac.id/upload/images/IMG_131714022019_3625.JPG\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"></span></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">DPW I Perhimpunan Organisasi Profesi Mahasiswa Sosial Ekonomi Pertanian Indonesia (POPMASEPI) menyelenggarakan Seminar Nasional dan Field Trip. Pada kegiatan kali ini Himpunan Mahasiswa Sosial Ekonomi Fakultas Pertanian Universitas Sriwijaya (FP Unsri) didaulat menjadi panitia dan tuan rumah.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_1326%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Seminar Nasional yang mengusung tema “Stabilisasi Perekonomian dan Kesejahteraan Petani dengan Mengoptimalkan Potensi Lokal Guna Memajukan Sektor Pertanian dalam Menghadapi Revolusi Industri 4.0” tersebut berlangsung di Auditorium Unsri Indralaya, pada Rabu (13/2/2019).</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_1287%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Acara yang dibuka secara resmi oleh Wakil Rektor Bidang Kemahasiswaan Unsri, Dr dr Mohammad Zulkarnain ini menghadirkan narasumber yang berkompeten dibidangnya yakni, Kepala Pusat Distribusi dan Cadangan Pangan Kementerian Pertanian RI Prof Dr Ir Risfaheri MSi dan Direksi Manajer Pengembangan Produk dan Pasar PT PUSRI Fakhrurrazi.</p><p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p></p><h2 style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-indent: 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">Untuk diketahui, POPMASEPI merupakan perhimpunan Organisasi Profesi Mahasiswa Sosial Ekonomi Pertanian Indonesia, yang mana perhimpunan ini menjadi wadah tempat berkumpulnya mahasiswa sosial ekonomi pertanian yang bertujuan untuk memajukan pertanian di Indonesia. POPMASEPI terdiri dari beberapa Dewan Pimpinan Wilayah. Salah satu DPW POPMASEPI adalah DPW I yang mengintegrasikan perhimpunan mahasiswa sosial ekonomi pertanian dari institusi-institusi dalam lingkup Sumatera.(Ara)</h2>', 'info', 'IMG_1326_-_Copy.JPG', '2019-04-05 20:20:00', 17, 'dpw-i-popmasepi-gelar-seminar-nasional-di-universitas-sriwijaya-35'),
(32, 'Pelepasan Calon Wisudawan Fakultas Hukum Universitas Sriwijaya', '<h2><br></h2><div><img width=\"585px\" src=\"http://www.unsri.ac.id/upload/images/IMG_833514022019_4951.JPG\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"></span><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Fakultas Hukum Universitas Sriwijaya (FH Unsri) menggelar rapat senat terbuka dalam rangka pelantikan/ pelepasan Magister Kenotariatan wisuda ke-33, Magister Hukum wisuda ke-86, dan Doktor Ilmu Hukum wisuda ke-17 tahun 2019, yang berlangsung di Hall FH Tower Lt.8 Unsri kampus palembang, Selasa (12/2/2019).</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_8318-1%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Sejumlah 90 orang calon wisudawan yang dilantik yaitu dari Magister Kenotariatan sebanyak 78 orang, Magister Hukum sebanyak 8 orang, dan Doktor Ilmu Hukum sebanyak 4 orang.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_8294%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Rapat senat tersebut dibuka secara resmi oleh Ketua Senat FH Unsri Dr Mada Apriandi SH MCI, sementara pelantikan/pelepasan dilakukan langsung oleh Dekan FH Unsri Dr Febrian SH MS. Dalam kesempatan itu Dr Ferbrian mengatakan bahwa hari ini merupakan momen yang luar biasa, menurutnya walaupun terkesan rutin, tapi ini menjadi suatu kegiatan yang sangat penting dalam pencapaian prestasi di bidang akademik.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_8353%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><h2 style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Turut hadir dalam acara pelepasan itu yakni Wakil Rektor Bidang Akademik Prof Zainuddin Nawawi PhD. Dalam sambutannya, Prof Zainuddin menyampaikan ucapan selamat atas apa yang dicapai sehingga berhak menyandang gelar Magister Kenotariatan, Magister Hukum, dan Doktor Ilmu Hukum.(Ara)&nbsp;</h2></div>', 'info', 'IMG_8294_-_Copy.JPG', '2019-03-13 19:22:22', 19, 'pelepasan-calon-wisudawan-fakultas-hukum-universitas-sriwijaya-51'),
(33, 'Unsri Gelar Rakor Untuk Penguatan Pelaksanaan Program Dan Kegiatan Tahun Anggaran 2019', '<h2><br></h2><div><img width=\"585px\" src=\"http://www.unsri.ac.id/upload/images/WhatsApp%20Image%202019-02-08%20at%201911022019_4600.jpeg\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"></span><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Rapat Koordinasi (Rakor) Universitas Sriwijaya (Unsri) Tahun 2019 untuk penguatan pelaksanaan program dan kegiatan Tahun Anggaran 2019 serta arah kebijakan umum rektor tahun 2020 diselenggarakan di Graha Sriwijaya Kampus Unsri Palembang, Jumat (8/2/2019).</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/WhatsApp%20Image%202019-02-08%20at%2019_28_38%20-%20Copy.jpeg\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Rakor dipimpin langsung oleh Rektor Unsri Prof Dr Ir H Anis Saggaff MSCE dan dihadiri oleh Wakil Rektor, Ketua Satuan Pengawas Intern, Dekan, Wakil Dekan, Direktur Program Pascasarjana, Wakil Direktur Program Pascasarjana, Ketua Lembaga, Kepala Biro, Kabag, Sekretaris Lembaga, Ketua Jurusan/Program Studi di lingkungan Unsri.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/WhatsApp%20Image%202019-02-08%20at%2019_28_40%20-%20Copy.jpeg\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><h2 style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Dalam rakor tersebut rektor memaparkan diantaranya tentang empat fokus target yang harus dicapai yaitu, pendidikan, penelitian, pengabdian, dan masa studi. Selain itu rektor juga menyebutkan agar mengoptimumkan fungsi fakultas, jurusan, prodi, dan laboratorium agar memberikan pelayanan administrasi efektif, pelayanan keuangan yang efisien, menggunakan sarana dan prasarana untuk tri-darma, dan pemantauan penjaminan mutu yang efektif.(Ara)</h2></div>', 'news', 'WhatsApp_Image_2019-02-08_at_1911022019_4600.jpeg', '2019-04-05 20:19:42', 25, 'unsri-gelar-rakor-untuk-penguatan-pelaksanaan-program-dan-kegiatan-tahun-anggaran-2019-95'),
(35, 'Pelantikan Pengurus ISEI Cabang Palembang Periode 2019-2022 Dan Kuliah Umum Gubernur BI', '<p><img width=\"585px\" src=\"http://www.unsri.ac.id/upload/images/IMG_9378%20-%20Copy11012019_3379.JPG\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"></span></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Ketua Umum Pengurus Pusat Ikatan Sarjana Ekonomi Indonesia (ISEI), yang juga menjabat sebagai Gubernur Bank Indonesia, Perry Warjiyo SE MSc PhD melantik pengurus ISEI Cabang Palembang periode 2019-2022 sekaligus memberikan Kuliah Umum yang diberi tema \"Perekonomian Indonesia: Prospek dan Bauran Kebijakan\" bertempat di Graha Sriwijaya Bukit Besar Palembang, Jumat (11/1/2019).</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_9382%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"><br>\"Selamat kepada ketua dan seluruh pengurus dan insha Allah tahun ini kita akan lebih memperkuat komitmen untuk memajukan ISEI\" ujar Ferry memberi sambutan usai melantik pengurus ISEI.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Dia juga menuturkan, ada tiga peranan penting ISEI dalam memajukan perekonomian yaitu ISEI harus berperan aktif dalam memyampaikan berbagai rekomendasi kebijakan – kebijakan ekonomi, ISEI harus berperan aktif memajukan kualitas akademika, dan ISEI harus mampu menjalin sinergi.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_9361%20-%20Copy(1).jpg\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_9371%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">\"ISEI mempunyai peran penting didalam memajukan perekonomian kita, setidaknya adalah dalam tiga bagian penting, yang pertama ISEI itu harus berperan aktif dalam menyampaikan berbagai rekomendasi kebijakan – kebijakan ekonomi untuk memajukan ekonomi kita baik di tingkat pusat maupun di tingkat daerah, yang kedua ISEI harus berperan aktif memajukan kualitas akademika kita baik kualitas pengajaran maupun kualitas penelitian, dan yang ketiga yaitu ISEI harus mampu menjalin sinergi, ISEI tidak bisa tegak sendiri\" Tuturnya.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_9398%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"><br>Sementara, Wakil Rektor Bidang Umum, Kepegawaian, dan Keuangan Universitas Sriwijaya (Unsri), Mukhtaruddin SE Ak MSi dalam sambutannya mengatakan selama ini ISEI dan BI memberikan kontribusi yang sangat baik terhadap pengembangan Unsri, banyak kegiatan kerjasama antara Fakultas Ekonomi Unsri dengan ISEI Cabang palembang. Sedangakan BI banyak memberikan kontribusi terhadap pengembangan mahasiswa Unsri melalui beasiswa BI, selain itu ia juga menyebutkan untuk mata kuliah kebanksentralan dan ekonomi moneter banyak kontribusi dari BI untuk memberikan materi terhadap dua mata kuliah tersebut.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Pada kesempatan itu, Mukhtaruddin juga meminta agar Gubernur BI menambah kuota penerima beasiswa BI yang semula hanya 10 orang agar ditambah menjadi 15 atau 20 orang penerima beasiswa BI.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_9338%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"><br>Acara ini dihadiri oleh ribuan peserta. Turut hadir pada acara tersebut diantaranya Wakil Ketua Komisi XI DPR RI, Sekretaris Umum Pengurus Pusat ISEI, Pimpinan Satuan Kerja BI, Pimpinan Organisasi Perangkat Daerah Provinsi Sumatera Selatan, Mahasiswa Unsri, dan tamu undangan lainnya.(Ara)</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><strong>Adapun susunan pengurus ISEI Cabang Palembang Periode 2019-2022, diantaranya sebagai berikut:</strong></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><strong>Ketua	:</strong>&nbsp;Prof. Dr. Taufiq Marwa, M.Si<br><strong>Wakil Ketua I	:</strong>&nbsp;Hari Widodo, SE., MSc<br><strong>Wakil Ketua II	:</strong>&nbsp;Isnurhadi, SE., M.B.A., Ph.D<br><strong>Sekretaris	:</strong>&nbsp;Marlina Widiyanti, SE., SH., MM., Ph.D<br><strong>Wakil Sekretaris I	:</strong>&nbsp;Ichsan Hamidi, S.H.I., M.Si<br><strong>Wakil Sekretaris II	:</strong>&nbsp;Muhammad Ichsan Hadjri, S.T., MM</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><strong>Bidang Organisasi	</strong><br><strong>Ketua	:&nbsp;</strong>Prof. Dr. Sulastri, ME., M.Komp</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><strong>Bidang Hubungan Pemerintah dan Kerjasama Antar Lembaga<br>Ketua	:</strong>&nbsp;Prof. Dr. Didik Susetyo, M.Si</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><strong>Bidang Publikasi dan Hubungan Masyarakat&nbsp;<br>Ketua	:</strong>&nbsp;Drs. M. Komri Yusuf, M.Si</p><p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-indent: 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><h2><strong>Bidang Kaderisasi dan hubungan dengan Perguruan Tinggi<span>&nbsp;</span></strong></h2><strong>Ketua	:</strong><span>&nbsp;</span>Syaful Sahri, SE., M.Si</p>', 'info', 'IMG_9378_-_Copy11012019_3379.JPG', '2019-04-26 17:45:40', 42, 'pelantikan-pengurus-isei-cabang-palembang-periode-2019-2022-dan-kuliah-umum-gubernur-bi-94'),
(36, 'Prodi HI Fisip Unsri Gelar Kuliah Umum Diplomasi Untuk Kepentingan Rakyat', '<h2><img width=\"585px\" src=\"http://www.unsri.ac.id/upload/images/IMG_081628012019_4820.JPG\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"font-family: Tahoma, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"></span><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Prodi Hubungan Internasional (HI) Fakultas Ilmu Sosiologi dan Ilmu Politik (Fisip) Universitas Sriwijaya (Unsri) menggelar kuliah umum yang diberi tema diplomasi untuk kepentingan rakyat, yang berlangsung di Aula Gedung C kampus Unsri Indralaya, Senin (28/1/2019). Acara yang dibuka secara resmi oleh Wakil Dekan Bidang Akademik Fisip, Prof Dr Alfitri MSi ini dihadiri oleh dosen dan ratusan mahasiswa Prodi HI dengan menghadirkan narasumber Duta Besar Republik Indonesia untuk Austria, Dr Darmansyah Djumala.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"><img src=\"http://www.unsri.ac.id/userfiles/IMG_0800%20-%20Copy.JPG\" width=\"500\" height=\"333\" alt=\"\" style=\"border: 1px solid rgb(204, 204, 204); margin: 4px 10px 3px 0px; padding: 2px;\"></p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Dalam paparannya, Dr Darmansyah Djumala menjelaskan diantaranya tentang pengertian diplomasi dalam hubungan internasional, tentang etika atau adab utama diplomasi, dan tentang diplomasi sebagai seni untuk mencapai tujuan.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Prof Alfitri mengungkapkan tujuan diselenggarakannya kuliah umum ini untuk berbagi pengalaman dari para dosen di luar Unsri dan dari para praktisi. Dikatakannya acara ini khusus untuk mahasiswa jurusan Ilmu Hubungan Internasional yang diselenggarakan supaya ada keseimbangan antara kelas Indralaya dan kelas Palembang dalam mendapatkan kuliah umum sehingga mereka dapat berbagi pengalaman. “Hari ini kita mendatangkan praktisi sekaligus dosen untuk berbagi bagaimana berdiplomasi dengan baik untuk kepentingan rakyat” ujarnya saat ditemui disela-sela acara kuliah umum.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Lebih jauh dia menuturkan Tahun ini memprogramkan yang namanya internasionalisasi FISIP yaitu mengirimkan mahasiswa jurusan HI ke beberapa kedutaan besar Indonesia di luar negeri. “Yang kita pilih Duta Besar Austria kemudian Duta Besar Indonesia di Kuala Lumpur dan kedutaan besar Indonesia di Brunei Darussalam. kita juga akan mengirimkan mahasiswa untuk kuliah di mancanegara yaitu di beberapa universitas di Malaysia yaitu Universitas Kebangsaan Malaysia, Universitas Teknologi Petronas dan Universitas Zainal Abidin. jadi kita akan kirimkan 20 hingga 30 Mahasiswa FISIP untuk bisa belajar di sana selama 3 minggu” tuturnya.</p><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\">Dia berharap dari kegiatan ini akan menambah wawasan dan menambah jaringan. “Dari kegiatan ini saya berharap akan menambah wawasan kemudian akan menambah jaringan dan yang paling penting adalah bagaimana membentuk kecerdasan intelektual dan emosional mereka sebagai calon lulusan terbaik dari Universitas Sriwijaya” pungkasnya.(Ara)</p><h2><br></h2><p style=\"color: rgb(51, 51, 51); margin: 10px 0px; text-align: justify; line-height: 12px; padding: 0px; font-family: Tahoma, Helvetica, sans-serif; font-size: 11px;\"></p></h2>', 'news', 'IMG_081628012019_4820.JPG', '2019-04-05 19:41:23', 9, 'prodi-hi-fisip-unsri-gelar-kuliah-umum-diplomasi-untuk-kepentingan-rakyat-85'),
(55, 'Excelloka, Program Pelatihan Berkelanjutan Untuk UMKM Indonesia', '<p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Excellence.asia sebagai salah satu&nbsp;<em>startup training marketplace</em>&nbsp;binaan IDX Incubator telah meresmikan Excelloka. Excelloka adalah program pelatihan berkelanjutan untuk UMKM Indonesia. Diharapkan akan menjadi dimensi bagi UMKM Indonesia untuk bisa mempercepat perkembangan bisnisnya.</p><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Excelloka hadir dengan tujuan memberikan pelatihan berkualitas secara menyeluruh untuk meningkatkan&nbsp;<a href=\"https://goukm.id/apa-itu-ukm-umkm-startup/\" style=\"color: rgb(12, 68, 119) !important; font-weight: 600 !important;\">kualitas UMKM</a>, mulai dari pemasaran, penjualan,&nbsp;<em>branding</em>, pelayanan pelanggan, hukum, administrasi, keuangan, akuntansi, pajak, operasional, dan sumber daya manusia secara gratis.</p><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Metode yang digunakan adalah gabungan antara&nbsp;<em>online training</em>&nbsp;dan&nbsp;<em>offline workshop</em>. UMKM yang berminat hanya diwajibkan membayar dana komitmen sebesar Rp2,5 juta hingga Rp3,5 juta. Dana tersebut nantinya akan dikembalikan secara penuh di akhir pelatihan.</p><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Target dari Excelloka adalah UMKM di Indonesia khususnya di Jabodetabek. Selama delapan bulan, diharapkan lebih dari 1,500 UMKM di Indonesia dapat merasakan dimensi percepatan bisnis melalui Excelloka.</p><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">EXCELLOKA juga akan mengunjungi sembilan kota pusat UMKM lain di Indonesia, seperti Bandung, Yogyakarta, Semarang, Surabaya, Malang, Denpasar, Medan, Palembang, dan Makassar.</p><div class=\"td-g-rec td-g-rec-id-content_inline td_uid_2_5da182aa60050_rand td_block_template_1 \" style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\"></div><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">UMKM yang ingin mendaftar EXCELLOKA dapat mendaftarkan diri dengan cara online melalui www.excelloka.com. Dalam&nbsp;<a href=\"https://goukm.id/pelatihan-kursus-workshop-gtc/\" style=\"color: rgb(12, 68, 119) !important; font-weight: 600 !important;\">pelatihan</a>&nbsp;ini, akan dilakukan Penilaian Kesehatan UMKM yang bekerja sama dengan School of Business Management – Institut Teknologi Bandung. Peserta nantinya akan memperoleh hasil penilaian kesehatan bisnis yang ia jalankan.</p><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">“Melalui program Excelloka, Excellence.asia hadir memberikan pilihan kepada setiap bisnis dan individu dalam mendapatkan pelatihan, termasuk UMKM Indonesia. Hal ini sejalan dengan visi kami untuk mewujudkan ekosistem digital dalam industri pelatihan di mana pengetahuan dapat diakses oleh semua orang tanpa batas,” ujar Viktor Yanuar S, selaku CEO dan CoFounder excellence.asia.</p>', 'info', 'a9422d2e8cba55658fdb65b0ffce359b.jpg', '2019-07-26 04:25:45', 1629, 'excelloka-program-pelatihan-berkelanjutan-untuk-umkm-indonesia-11'),
(56, 'Dukung Perkembangan UKM, Pertamina Siapkan Dana Rp15 Miliar', '<p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Di tahun 2017, PT Pertamina telah menyalurkan dana sebesar Rp8,5 miliar untuk bantuan modal lunak bagi ribuan UKM se-Sulawesi. Pada tahun ini, PT Pertamina menargetkan, agar bisa menyalurkan hingga Rp15 miliar untuk para pelaku&nbsp;<a href=\"https://goukm.id/apa-itu-ukm-umkm-startup/\" style=\"color: rgb(12, 68, 119) !important; font-weight: 600 !important;\">Usaha Kecil Menengah</a>&nbsp;(UKM).</p><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Dilansir dari makassar.terkini.id, Roby Hervindo selaku Unit Manager Communication dan CSR MOR VII Pertamina mengatakan bahwa bantuan modal lunak tersebut nantinya merupakan SME dan SR (Small Medium Enterprise &amp; Social Responsibility).</p><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Ia juga mengatakan, setiap pelaku usaha bisa mendapatkan modal hingga maksimal Rp200 juta tanpa bunga dan hanya dikenakan biaya administrasi sebesar tiga persen saja. Selain itu, diberikan masa pengembalian hingga tiga tahun.</p><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Bagi Anda yang ingin mendapatkan bantuan modal tersebut, PT Pertamina hanya memberikan syarat yakni usaha setidaknya telah dijalankan selama minimal enam bulan, dan menulis surat pernyataan tidak pernah meminjam. Setelah itu, peminjam diharuskan untuk datang ke Kantor Pertamina MOR VII Sulawesi di Jalan Garuda Nomor 1 Makassar.</p><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Untuk nominal yang dipinjamkan, maksimum peminjaman adalah Rp200 juta. Namun, Pertamina juga memiliki penilaian yang dilakukan oleh tim&nbsp;<em>assessment</em>. Jika sebuah usaha dinilai hanya membutuhkan modal sebesar Rp50 juta, maka PT Pertamina akan memberikan Rp50 juta. Jadi, jumlah dana yang dipinjam bergantung pada penilaian yang nantinya diberikan oleh Pertamina.</p><div class=\"td-g-rec td-g-rec-id-content_inline td_uid_2_5da182801bb73_rand td_block_template_1 \" style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\"></div><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Adapun mitra binaan yang diberi bantuan lunak oleh Pertamina adalah bidang usaha yang bergerak dibidang peternakan, perikanan, perdagangan, dan industri kecil.</p><p style=\"font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 1.74; margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); text-align: justify;\">Melalui program kemitraan dan bina lingkungan, Pertamina berharap dapat mendukung perkembangan ekonomi masyarakat kecil secara berkelanjutan.</p>', 'info', 'f8ce13e050128211879f7c2328ee2c57.jpg', '2019-07-27 20:25:41', 2768, 'dukung-perkembangan-ukm-pertamina-siapkan-dana-rp15-miliar-5'),
(57, 'Pencairan Dana UKM Desa', 'Saat ini para UKM sudah bisa melakukan pengusulan pencairan dana melalui kepala desa. hal ini bertujuan untuk mendongkrak kemajuan dari kegiatan itu sendiri', 'info', '38476f63084e10abd4dc02752517e06a.jpg', '2019-07-30 18:56:46', 1808, 'pencairan-dana-ukm-desa-13');
